import React, { useEffect, useState } from "react";
import { Api } from "./api";

function App() {
  const [user, setUser] = useState([]);
  const FetchUserData = async () => {
    const data = await Api('https://api.escuelajs.co/api/v1/users')
    if(data){
      console.log(data);
    }
  }
  useEffect(() => {
    FetchUserData()
  }, [])
  return (
    <div className="App">
        <div className="table">
          <table>
            <thead>
              <tr>
                <td>Id</td>
                <td>Name</td>
                <td>Email</td>
                <td>Role</td>
                <td>Avatar</td>
                <td>Actions</td>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>1</td>
                <td>John</td>
                <td>John@mail.com</td>
                <td>Customer</td>
                <td>User Profile</td>
                <td></td>
              </tr>
            </tbody>
          </table>
        </div>
    </div>
  );
}

export default App;
